import React from "react";
import {Navbar} from "./Components/Header/navbar"
import {ItemListContainer} from "./Components/Products/ItemListContainer"
import 'boxicons';

function message(props) {

  return(
      <div className="props">
       <p>{props.message}</p>   
      </div>
  );
}
function App() {
  return (
    <div className="App">

      <Navbar />

      <ItemListContainer product="Error"/>





    </div>
  );
}

export default App;
